import React from 'react';
import ReactDom from 'react-dom';
import './index.css';

const author = 'Héctor García';
const title = 'Ikigai';
const img = 'https://images-na.ssl-images-amazon.com/images/I/51T8OXMiB5L._SX356_BO1,204,203,200_.jpg'
function BookList(){
  return(
    <section className="bookList">
      <div>
        <Book/>
        <Book/>
        <Book/>
      </div>
    </section>
  )
}


const Book = () =>{
  return (
    <article className='Book'>
       <img src={img} title="" />
      <h1>{title}</h1>
      <h4>{author}</h4>
    </article>
  )
}

ReactDom.render(<BookList/>,document.getElementById('root'))
